import React from "react";
import {Col, Row} from "react-bootstrap";


const Login = (props) =>{
    return(
        <Row>
            <Col xs='12'><h1>Login</h1></Col>
            <Col xs='12'>
                <span>Введите логин</span>
                <textarea name="" id="" placeholder='Введите логин'></textarea>
                <textarea name="" id="" placeholder='Введите пароль'></textarea>
            </Col>
        </Row>

    )
}

export default Login
